import React from "react";

const Contact = () => {
  return (
    <div className="h-screen bg-gradient-to-br from-green-500 to-blue-300">
      <div className="flex w-full min-h-screen justify-center items-center">
        <div className="bg-cyan-700 w-full max-w-4xl">Text center</div>
      </div>
    </div>
  );
};

export default Contact;
